import React from 'react'

const Footer = () => {
    return (
        <div className="footer-div">
            <h5>Made by Noah Winkelman</h5>
            <a className="footer-icon" href="https://github.com/noahdubs"><i class="fab fa-github"></i></a>
            <a className="footer-icon" href="https://www.linkedin.com/in/noah-winkelman-27153a193/"><i class="fab fa-linkedin"></i></a>
        </div>
    )
}

export default Footer
